import React, { Component } from "react";

function getDate() {
    let date = new Date();
    let dateString = `${date.getFullYear()}-${date.getMonth()}-${date.getDate()}`
    return dateString;
}

class Calendar extends Component {
    render() {
        return(
            <>
                <p> {getDate()}</p>
            </>
            );
    }

}

export default Calendar;
